(4, 1, 'Clean Green Nature Nepal', 'clean-green-nature-nepal-4', 3, NULL, 'diamond', '5d315f9fb873ee8660f115dc03882b39.1560824875.jpg', NULL, NULL, NULL, 'cleangreennaturenepal@gmail.com', 'Kalimati', '<p>NA</p>', '2019-06-17 13:12:42', '2019-06-18 22:00:58'),
(5, 1, 'Agni Hospitality Supplies Pvt. Ltd.', 'agni-hospitality-supplies-pvt-ltd', 1, NULL, 'free_listing', 'bf9a938b5ef239ecc1f840d04fe5ec2f.1560823845.jpg', '984-1138576', NULL, NULL, 'agnihospitality.supplies@gmail.com', 'Basundhara Kathmandu, Nepal', '<p>We stock an exceptional quality of products at an affordable price on the market under these categories:</p>\r\n\r\n<ul>\r\n	<li>Kitchen Utensils - Cutlery, Drink-ware, Bar-ware, Tabletop &amp; Buffet, Kitchen Equipment</li>\r\n	<li>Janitorial Supplies - Handheld cleaners, Mops, Safety signs, Sweepers &amp; Squeegees, Wipes &amp; cloths, Brooms, Duster, Laundry baskets etc.</li>\r\n	<li>Disposables - Napkins, Toilet Paper, Food wraps, First Aid, Straws, Take away, Gloves etc.</li>\r\n	<li>Chemicals for cleaning supplies - Atomizers, Sprays &amp; Dispenser, Chemicals (Dish-washing/Toilet cleaning), Laundry products, Deodorizers etc.</li>\r\n	<li>Housekeeping Supplies - Guest Room amenities, Bed/Bath &amp; Table linens, Hand sanitizers, Soaps, Shampoo &amp; Conditioner, Body wash, Lotions etc.</li>\r\n	<li>Consumables- Creamers, White/Raw sugar stick/sachet/bulk, Teabags, Flavored syrups, Jams, Ketchup, Mustard, Salt, Oil etc.</li>\r\n	<li>Facility Maintenance &amp; Hardware - Safety supply, Packaging supplies, Tool supply, Office Supply etc.</li>\r\n</ul>', '2019-06-18 07:10:45', '2019-06-18 07:14:17'),
(6, 1, 'Agni Hospitality Supplies Pvt. Ltd.', 'agni-hospitality-supplies-pvt-ltd-6', 1, NULL, 'diamond', 'e043d213199013a30282202151e9e7dc.1560824037.jpg', '984-1138576', NULL, NULL, 'agnihospitality.supplies@gmail.com', 'Basundhara Kathmandu, Nepal', '<p>We stock an exceptional quality of products at an affordable price on the market under these categories:</p>\r\n\r\n<ul>\r\n	<li>Kitchen Utensils - Cutlery, Drink-ware, Bar-ware, Tabletop &amp; Buffet, Kitchen Equipment</li>\r\n	<li>Janitorial Supplies - Handheld cleaners, Mops, Safety signs, Sweepers &amp; Squeegees, Wipes &amp; cloths, Brooms, Duster, Laundry baskets etc.</li>\r\n	<li>Disposables - Napkins, Toilet Paper, Food wraps, First Aid, Straws, Take away, Gloves etc.</li>\r\n	<li>Chemicals for cleaning supplies - Atomizers, Sprays &amp; Dispenser, Chemicals (Dish-washing/Toilet cleaning), Laundry products, Deodorizers etc.</li>\r\n	<li>Housekeeping Supplies - Guest Room amenities, Bed/Bath &amp; Table linens, Hand sanitizers, Soaps, Shampoo &amp; Conditioner, Body wash, Lotions etc.</li>\r\n	<li>Consumables- Creamers, White/Raw sugar stick/sachet/bulk, Teabags, Flavored syrups, Jams, Ketchup, Mustard, Salt, Oil etc.</li>\r\n	<li>Facility Maintenance &amp; Hardware - Safety supply, Packaging supplies, Tool supply, Office Supply etc.</li>\r\n</ul>', '2019-06-18 07:13:57', '2019-06-18 22:08:57'),
